pragma solidity >=0.6.0 <0.8.0;
pragma experimental ABIEncoderV2;
import './Wallet.sol';
import '../node_modules/@openzeppelin/contracts/math/SafeMath.sol';
contract Dex is Wallet{
    using SafeMath for uint256;
    enum Side{
        BUY,
        SELL
    }
    uint256 public unique_id=0;
    struct Order{
        uint id;
        address trader;
        Side side;
        uint ammount;
        uint price;
        uint filled;
    }
    mapping(bytes32=>mapping(uint=>Order[])) public orderBook;
    function getOrderBook(bytes32 ticker,Side side) public view returns(Order[] memory){
        return orderBook[ticker][uint(side)];
    }
    function createLimitOrder(Side side,bytes32 ticker,uint ammount,uint price) public{
        if(side==Side.BUY){
            require(balances[msg.sender]['ETH']>=ammount.mul(price));
        }
        else if(side==Side.SELL){
            require(balances[msg.sender][ticker]>=ammount);
        }
        Order[] storage _order=orderBook[ticker][uint(side)];
        _order.push(Order(unique_id,msg.sender,side,ammount,price,0));
        unique_id++;
        if(side==Side.BUY){
            for(uint256 i=0;i<_order.length-1;i++){
                for(uint256 j=0;j<_order.length-1-i;j++){
                    if(_order[j].price<_order[j+1].price){
                        Order memory temp=_order[j];
                        _order[j]=_order[j+1];
                        _order[j+1]=temp;
                    }
                }
            }
        }
        else{
            for(uint256 i=0;i<_order.length-1;i++){
                for(uint256 j=0;j<_order.length-1-i;j++){
                    if(_order[j].price>_order[j+1].price){
                        Order memory temp=_order[j];
                        _order[j]=_order[j+1];
                        _order[j+1]=temp;
                    }
                }
            }
        }
    }
    function createMarketOrder(Side side,bytes32 ticker,uint ammount) public{
        if(side==Side.SELL){
            require(ammount<=balances[msg.sender][ticker]);
        }
        Order[] storage _orderbook=orderBook[ticker][1-uint(side)];
        uint totalFilled=0;
        for(uint i=0;i<_orderbook.length&& totalFilled<ammount;i++){
            uint leftTofill=ammount.sub(totalFilled);
            uint avaliableToFill=_orderbook[i].ammount.sub(_orderbook[i].filled);
            uint filled=0;
            if(avaliableToFill>leftTofill) {filled=leftTofill;}
            else{filled=avaliableToFill;}
            totalFilled=totalFilled.add(filled);
            _orderbook[i].filled=_orderbook[i].filled.sub(filled);
            if(side==Side.BUY){
                require(balances[msg.sender]['ETH']>=filled.mul(_orderbook[i].price));
                balances[msg.sender][ticker]=balances[msg.sender][ticker].add(filled);
                uint cost=filled.mul(_orderbook[i].price);
                balances[msg.sender]['ETH']=balances[msg.sender]['ETH'].sub(cost);

                balances[_orderbook[i].trader][ticker]=balances[_orderbook[i].trader][ticker].sub(filled);
                balances[_orderbook[i].trader]['ETH']=balances[_orderbook[i].trader]['ETH'].add(cost);
            }
            else
            {
                balances[msg.sender][ticker]=balances[msg.sender][ticker].sub(filled);
                uint cost=filled.mul(_orderbook[i].price);
                balances[msg.sender]['ETH']=balances[msg.sender]['ETH'].add(cost);
                balances[_orderbook[i].trader][ticker]=balances[_orderbook[i].trader][ticker].add(filled);
                balances[_orderbook[i].trader]['ETH']=balances[_orderbook[i].trader]['ETH'].sub(cost);
            }
        }
        while(_orderbook.length>0&&_orderbook[0].filled==_orderbook[0].ammount){
            for(uint i=0;i<_orderbook.length-1;i++){
                _orderbook[i]=_orderbook[i+1];
            }
            _orderbook.pop();
        }
    }
}
